import React, {useState,useEffect} from 'react';
//import axios from 'axios';
const Info=()=>{
  const [datas,setDatas]=useState(null)

    useEffect(()=>{
    fetch("http://localhost:3001/read") 
    .then(res=>res.json())
 .then(data =>{
   setDatas(data);
 })
 .catch(err=>console.log(err))
    })
  return <>
  {datas?.payload.findAll.map((todo)=>{
    const {id, name,fatherName, motherName,address, image}=todo;
    return <article key={id}>
    <p>Name:{name}</p>
    <img style={{height:"490px", width:"400px"}}  src={image} alt="photos" />
    <p>Father_Name:{fatherName}</p>
      <p>Mother_name:{motherName}</p>
      <p>Address:{address}</p>
    </article>
  })}
  </>
}
export default Info;
